                                         AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\\n     app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\\n     DATE_FORMAT(pa.start_date_time, \\"%d/%m/%Y\\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\\n     CONCAT(DATE_FORMAT(pa.start_date_time, \\"%l:%i %p\\"), \\" - \\", DATE_FORMAT(pa.end_date_time, \\"%l:%i %p\\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\\n     CONCAT(pn.given_name, \\" \\", pn.family_name)                                                      AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\\n     pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`\\nFROM\\npatient_appointment pa\\nJOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\\nJOIN appointment_service app_service\\n ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\\nLEFT JOIN patient_appointment_provider pap on pa.patient_appointment_id = pap.patient_appointment_id AND (pap.voided=0 OR pap.voided IS NULL)\\nLEFT JOIN provider prov ON prov.provider_id = pap.provider_id AND prov.retired IS FALSE\\nLEFT JOIN person_name pn ON pn.person_id = prov.person_id AND pn.voided IS FALSE\\nLEFT JOIN appointment_service_type app_service_type\\n ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\\nWHERE p.uuid = ${patientUuid} AND pa.start_date_time < CURDATE() AND (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\\nORDER BY pa.start_date_time DESC\\nLIMIT 5;","SELECT\\n  b.bed_number AS \\"Bed\\",\\n  concat(pn.given_name,\\" \\", ifnull(pn.family_name,\\"\\")) AS \\"Name\\",\\n  pi.identifier AS \\"Id\\",\\n  pv.gender AS \\"Gender\\",\\n  TIMESTAMPDIFF(YEAR, pv.birthdate, CURDATE()) AS \\"Age\\",\\n  admission_provider_name.given_name AS \\"Admission By\\",\\n  cast(DATE_FORMAT(latestAdmissionEncounter.max_encounter_datetime, \\"%d %b %y %h:%i %p\\") AS CHAR) AS \\"Admission Time\\",\\n  adtNotes.value_text AS \\"ADT Notes\\",\\n  dispositionInfo.providerName AS \\"Disposition By\\",\\n  cast(DATE_FORMAT(dispositionInfo.providerDate, \\"%d %b %y %h:%i %p\\") AS CHAR) AS \\"Disposition Time\\",\\n  diagnosis.diagnosisConcept AS \\"Diagnosis\\",\\n  diagnosis.certainty AS \\"Diagnosis Certainty\\",\\n  diagnosis.diagnosisOrder AS \\"Diagnosis Order\\",\\n  diagnosis.status AS \\"Diagnosis Status\\",\\n  diagnosis.diagnosis_provider AS \\"Diagnosis Provider\\",\\n  cast(DATE_FORMAT(diagnosis.diagnosis_datetime, \\"%d %b %y %h:%i %p\\") AS CHAR) AS \\"Diagnosis Datetime\\"\\nFROM bed_location_map blm\\n  INNER JOIN bed b\\n    ON blm.bed_id = b.bed_id AND b.status = \\"OCCUPIED\\"\\n  INNER JOIN location l on blm.location_id = l.location_id and l.name = ${location_name}\\n  INNER JOIN bed_patient_assignment_map bpam ON b.bed_id = bpam.bed_id AND date_stopped IS NULL\\n  INNER JOIN person pv ON pv.person_id = bpam.patient_id\\n  INNER JOIN person_name pn ON pn.person_id = pv.person_id\\n  INNER JOIN patient_identifier pi ON pv.person_id = pi.patient_id\\n  INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\\n  INNER JOIN global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid\\n  INNER JOIN (\\n        SELECT patient_id, max(encounter_datetime) AS max_encounter_datetime,\\n          max(visit_id) as visit_id, max(encounter_id) AS encounter_id\\n        FROM encounter INNER JOIN encounter_type ON encounter_type.encounter_type_id = encounter.encounter_type\\n        WHERE encounter_type.name = \\"ADMISSION\\"\\n        GROUP BY patient_id) latestAdmissionEncounter\\n      ON pv.person_id = latestAdmissionEncounter.patient_id\\n  LEFT OUTER JOIN obs adtNotes\\n    ON adtNotes.encounter_id = latestAdmissionEncounter.encounter_id\\n    AND adtNotes.voided = 0\\n    AND adtNotes.concept_id = (SELECT concept_id\\n                              FROM concept_name\\n                              WHERE name = \\"Adt Notes\\" AND concept_name_type = \\"FULLY_SPECIFIED\\" AND locale = \\"en\\")\\n  LEFT OUTER JOIN encounter_provider ep ON ep.encounter_id = latestAdmissionEncounter.encounter_id\\n  LEFT OUTER JOIN provider admission_provider ON admission_provider.provider_id = ep.provider_id\\n  LEFT OUTER JOIN person_name admission_provider_name\\n    ON admission_provider_name.person_id = admission_provider.person_id\\n  LEFT OUTER JOIN (\\n        SELECT\\n          bpam.patient_id AS person_id,\\n          concept_name.name AS disposition,\\n          latestDisposition.obs_datetime AS providerDate,\\n          person_name.given_name AS providerName\\n        FROM bed_patient_assignment_map bpam\\n          INNER JOIN (SELECT person_id, max(obs_id) obs_id\\n                      FROM obs WHERE concept_id = (SELECT concept_id\\n                          FROM concept_name\\n                          WHERE name = \\"Disposition\\" AND concept_name_type = \\"FULLY_SPECIFIED\\" AND locale = \\"en\\")\\n                      GROUP BY person_id)\\n                maxObsId ON maxObsId.person_id = bpam.patient_id\\n          INNER JOIN obs latestDisposition\\n            ON maxObsId.obs_id = latestDisposition.obs_id AND latestDisposition.voided = 0\\n          INNER JOIN concept_name ON latestDisposition.value_coded = concept_name.concept_id AND\\n                                     concept_name_type = \\"FULLY_SPECIFIED\\"\\n          LEFT OUTER JOIN encounter_provider ep ON latestDisposition.encounter_id = ep.encounter_id\\n          LEFT OUTER JOIN provider disp_provider ON disp_provider.provider_id = ep.provider_id\\n          LEFT OUTER JOIN person_name ON person_name.person_id = disp_provider.person_id\\n        WHERE bpam.date_stopped IS NULL\\n    ) dispositionInfo ON pv.person_id = dispositionInfo.person_id\\n  LEFT OUTER JOIN (\\n    SELECT\\n      diagnosis.person_id AS person_id,\\n      diagnosis.obs_id AS obs_id,\\n      diagnosis.obs_datetime AS diagnosis_datetime,\\n      if(diagnosisConceptName.name IS NOT NULL, diagnosisConceptName.name, diagnosis.value_text) AS diagnosisConcept,\\n      certaintyConceptName.name AS certainty,\\n      diagnosisOrderConceptName.name AS diagnosisOrder,\\n      diagnosisStatusConceptName.name AS status,\\n      person_name.given_name AS diagnosis_provider\\n    FROM bed_patient_assignment_map bpam\\n      INNER JOIN visit latestVisit\\n        ON latestVisit.patient_id = bpam.patient_id AND latestVisit.date_stopped IS NULL\\n        AND bpam.date_stopped IS NULL\\n      INNER JOIN encounter ON encounter.visit_id = latestVisit.visit_id\\n      INNER JOIN obs diagnosis ON bpam.patient_id = diagnosis.person_id AND diagnosis.voided = 0 AND\\n          diagnosis.encounter_id = encounter.encounter_id AND\\n          diagnosis.concept_id IN (\\n            SELECT concept_id FROM concept_name\\n            WHERE name IN (\\"Coded Diagnosis\\", \\"Non-Coded Diagnosis\\")\\n              AND concept_name_type = \\"FULLY_SPECIFIED\\" )\\n      LEFT OUTER JOIN concept_name diagnosisConceptName\\n        ON diagnosis.value_coded IS NOT NULL\\n        AND diagnosis.value_coded = diagnosisConceptName.concept_id\\n        AND diagnosisConceptName.concept_name_type = \\"FULLY_SPECIFIED\\"\\n        AND diagnosisConceptName.locale =\\"en\\"\\n      LEFT OUTER JOIN encounter_provider ep ON diagnosis.encounter_id = ep.encounter_id\\n      LEFT OUTER JOIN provider diagnosis_provider ON diagnosis_provider.provider_id = ep.provider_id\\n      LEFT OUTER JOIN person_name ON person_name.person_id = diagnosis_provider.person_id\\n      INNER JOIN obs certainty\\n        ON diagnosis.obs_group_id = certainty.obs_group_id AND certainty.voided = 0\\n        AND certainty.concept_id = (\\n          SELECT concept_id FROM concept_name\\n          WHERE name = \\"Diagnosis Certainty\\"\\n          AND concept_name_type = \\"FULLY_SPECIFIED\\"\\n          AND locale = \\"en\\")\\n      LEFT OUTER JOIN concept_name certaintyConceptName\\n        ON certainty.value_coded IS NOT NULL\\n        AND certainty.value_coded = certaintyConceptName.concept_id\\n        AND certaintyConceptName.concept_name_type = \\"FULLY_SPECIFIED\\"\\n        AND certaintyConceptName.locale = \\"en\\"\\n      INNER JOIN obs diagnosisOrder\\n        ON diagnosis.obs_group_id = diagnosisOrder.obs_group_id AND diagnosisOrder.voided = 0\\n        AND diagnosisOrder.concept_id = (\\n          SELECT concept_id FROM concept_name\\n          WHERE name = \\"Diagnosis order\\" AND concept_name_type = \\"FULLY_SPECIFIED\\" and locale =\\"en\\")\\n      LEFT OUTER JOIN concept_name diagnosisOrderConceptName\\n        ON diagnosisOrder.value_coded IS NOT NULL\\n        AND diagnosisOrder.value_coded = diagnosisOrderConceptName.concept_id\\n        AND diagnosisOrderConceptName.concept_name_type = \\"FULLY_SPECIFIED\\"\\n        AND diagnosisOrderConceptName.locale = \\"en\\"\\n      LEFT JOIN obs diagnosisStatus\\n        ON diagnosis.obs_group_id = diagnosisStatus.obs_group_id AND diagnosisStatus.voided = 0\\n        AND diagnosisStatus.concept_id = (\\n          SELECT concept_id FROM concept_name\\n          WHERE name = \\"Bahmni Diagnosis Status\\"\\n          AND concept_name_type = \\"FULLY_SPECIFIED\\"\\n          AND locale = \\"en\\")\\n      LEFT OUTER JOIN concept_name diagnosisStatusConceptName\\n        ON diagnosisStatus.value_coded IS NOT NULL\\n        AND diagnosisStatus.value_coded = diagnosisStatusConceptName.concept_id\\n        AND diagnosisStatusConceptName.concept_name_type = \\"FULLY_SPECIFIED\\"\\n        AND diagnosisStatusConceptName.locale = \\"en\\"\\n) diagnosis ON diagnosis.person_id = pv.person_id","SELECT\\n  b.bed_number AS 'Bed',\\n  concat(pn.given_name, ' ', ifnull(pn.family_name,'')) AS 'Name',\\n  pv.uuid AS 'Patient Uuid',\\n  pi.identifier AS 'Id',\\n  pv.gender AS 'Gender',\\n  TIMESTAMPDIFF(YEAR, pv.birthdate, CURDATE()) AS 'Age',\\n  pa.county_district AS 'District',\\n  pa.city_village AS 'Village',\\n  admission_provider_name.given_name AS 'Admission By',\\n  cast(DATE_FORMAT(latestAdmissionEncounter.max_encounter_datetime, '%d %b %y %h:%i %p') AS CHAR) AS 'Admission Time',\\n  diagnosis.diagnosisConcept AS 'Diagnosis',\\n  diagnosis.certainty AS 'Diagnosis Certainty',\\n  diagnosis.diagnosisOrder AS 'Diagnosis Order',\\n  diagnosis.status AS 'Diagnosis Status',\\n  diagnosis.diagnosis_provider AS 'Diagnosis Provider',\\n  cast(DATE_FORMAT(diagnosis.diagnosis_datetime, '%d %b %y %h:%i %p') AS\\n       CHAR) AS 'Diagnosis Datetime',\\n  dispositionInfo.providerName AS 'Disposition By',\\n  cast(DATE_FORMAT(dispositionInfo.providerDate, '%d %b %y %h:%i %p') AS CHAR) AS 'Disposition Time',\\n  adtNotes.value_text AS 'ADT Notes',\\n  v.uuid AS 'Visit Uuid'\\nFROM bed_location_map blm\\n  INNER JOIN bed b\\n    ON blm.bed_id = b.bed_id AND\\n       b.status = 'OCCUPIED' AND\\n       blm.location_id IN (SELECT child_location.location_id\\n                           FROM location child_location JOIN\\n                             location parent_location\\n                               ON parent_location.location_id =\\n                                  child_location.parent_location\\n                           WHERE\\n                             parent_location.name = ${location_name})\\n  INNER JOIN bed_patient_assignment_map bpam ON b.bed_id = bpam.bed_id AND date_stopped IS NULL\\n  INNER JOIN person pv ON pv.person_id = bpam.patient_id\\n  INNER JOIN person_name pn ON pn.person_id = pv.person_id\\n  INNER JOIN patient_identifier pi ON pv.person_id = pi.patient_id\\n  INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\\n  INNER JOIN global_property gp on gp.property='bahmni.primaryIdentifierType' and gp.property_value=pit.uuid\\n  LEFT JOIN person_address pa ON pa.person_id = pv.person_id\\n  INNER JOIN (SELECT\\n                patient_id,\\n                max(encounter_datetime) AS max_encounter_datetime,\\n                max(visit_id) as visit_id,\\n                max(encounter_id) AS encounter_id\\n              FROM encounter\\n                INNER JOIN encounter_type ON encounter_type.encounter_type_id = encounter.encounter_type\\n              WHERE encounter_type.name = 'ADMISSION'\\n              GROUP BY patient_id) latestAdmissionEncounter ON pv.person_id = latestAdmissionEncounter.patient_id\\n  INNER JOIN visit v ON latestAdmissionEncounter.visit_id = v.visit_id\\n  LEFT OUTER JOIN obs adtNotes\\n    ON adtNotes.encounter_id = latestAdmissionEncounter.encounter_id AND adtNotes.voided = 0 AND\\n       adtNotes.concept_id = (SELECT concept_id\\n                              FROM concept_name\\n                              WHERE name = 'Adt Notes' AND concept_name_type = 'FULLY_SPECIFIED')\\n  LEFT OUTER JOIN encounter_provider ep ON ep.encounter_id = latestAdmissionEncounter.encounter_id\\n  LEFT OUTER JOIN provider admission_provider ON admission_provider.provider_id = ep.provider_id\\n  LEFT OUTER JOIN person_name admission_provider_name\\n    ON admission_provider_name.person_id = admission_provider.person_id\\n  LEFT OUTER JOIN (\\n                    SELECT\\n                      bpam.patient_id AS person_id,\\n                      concept_name.name AS disposition,\\n                      latestDisposition.obs_datetime AS providerDate,\\n                      person_name.given_name AS providerName\\n                    FROM bed_patient_assignment_map bpam\\n                      INNER JOIN (SELECT\\n                                    person_id,\\n                                    max(obs_id) obs_id\\n                                  FROM obs\\n                                  WHERE concept_id = (SELECT concept_id\\n                                                      FROM concept_name\\n                                                      WHERE\\n                                                        name = 'Disposition' AND concept_name_type = 'FULLY_SPECIFIED')\\n                                  GROUP BY person_id) maxObsId ON maxObsId.person_id = bpam.patient_id\\n                      INNER JOIN obs latestDisposition\\n                        ON maxObsId.obs_id = latestDisposition.obs_id AND latestDisposition.voided = 0\\n                      INNER JOIN concept_name ON latestDisposition.value_coded = concept_name.concept_id AND\\n                                                 concept_name_type = 'FULLY_SPECIFIED'\\n                      LEFT OUTER JOIN encounter_provider ep ON latestDisposition.encounter_id = ep.encounter_id\\n                      LEFT OUTER JOIN provider disp_provider ON disp_provider.provider_id = ep.provider_id\\n                      LEFT OUTER JOIN person_name ON person_name.person_id = disp_provider.person_id\\n                    WHERE bpam.date_stopped IS NULL\\n                  ) dispositionInfo ON pv.person_id = dispositionInfo.person_id\\n  LEFT OUTER JOIN (\\n                    SELECT\\n                      diagnosis.person_id AS person_id,\\n                      diagnosis.obs_id AS obs_id,\\n                      diagnosis.obs_datetime AS diagnosis_datetime,\\n                      if(diagnosisConceptName.name IS NOT NULL, diagnosisConceptName.name,\\n                         diagnosis.value_text) AS diagnosisConcept,\\n                      certaintyConceptName.name AS certainty,\\n                      diagnosisOrderConceptName.name AS diagnosisOrder,\\n                      diagnosisStatusConceptName.name AS status,\\n                      person_name.given_name AS diagnosis_provider\\n                    FROM bed_patient_assignment_map bpam\\n                      INNER JOIN visit latestVisit\\n                        ON latestVisit.patient_id = bpam.patient_id AND latestVisit.date_stopped IS NULL AND\\n                           bpam.date_stopped IS NULL\\n                      INNER JOIN encounter ON encounter.visit_id = latestVisit.visit_id\\n                      INNER JOIN obs diagnosis ON bpam.patient_id = diagnosis.person_id AND diagnosis.voided = 0 AND\\n                                                  diagnosis.encounter_id = encounter.encounter_id AND\\n                                                  diagnosis.concept_id IN (SELECT concept_id\\n                                                                           FROM concept_name\\n                                                                           WHERE name IN\\n                                                                                 ('Coded Diagnosis', 'Non-Coded Diagnosis')\\n                                                                                 AND\\n                                                                                 concept_name_type = 'FULLY_SPECIFIED')\\n                      LEFT OUTER JOIN concept_name diagnosisConceptName\\n                        ON diagnosis.value_coded IS NOT NULL AND diagnosis.value_coded = diagnosisConceptName.concept_id\\n                           AND diagnosisConceptName.concept_name_type = 'FULLY_SPECIFIED'\\n                      LEFT OUTER JOIN encounter_provider ep ON diagnosis.encounter_id = ep.encounter_id\\n                      LEFT OUTER JOIN provider diagnosis_provider ON diagnosis_provider.provider_id = ep.provider_id\\n                      LEFT OUTER JOIN person_name ON person_name.person_id = diagnosis_provider.person_id\\n                      INNER JOIN obs certainty\\n                        ON diagnosis.obs_group_id = certainty.obs_group_id AND certainty.voided = 0 AND\\n                           certainty.concept_id = (SELECT concept_id\\n                                                   FROM concept_name\\n                                                   WHERE name = 'Diagnosis Certainty' AND\\n                                                         concept_name_type = 'FULLY_SPECIFIED')\\n                      LEFT OUTER JOIN concept_name certaintyConceptName\\n                        ON certainty.value_coded IS NOT NULL AND certainty.value_coded = certaintyConceptName.concept_id\\n                           AND certaintyConceptName.concept_name_type = 'FULLY_SPECIFIED'\\n                      INNER JOIN obs diagnosisOrder\\n                        ON diagnosis.obs_group_id = diagnosisOrder.obs_group_id AND diagnosisOrder.voided = 0 AND\\n                           diagnosisOrder.concept_id = (SELECT concept_id\\n                                                        FROM concept_name\\n                                                        WHERE name = 'Diagnosis order' AND\\n                                                              concept_name_type = 'FULLY_SPECIFIED')\\n                      LEFT OUTER JOIN concept_name diagnosisOrderConceptName ON diagnosisOrder.value_coded IS NOT NULL\\n                                                                                AND diagnosisOrder.value_coded =\\n                                                                                    diagnosisOrderConceptName.concept_id\\n                                                                                AND\\n                                                                                diagnosisOrderConceptName.concept_name_type\\n                                                                                = 'FULLY_SPECIFIED'\\n                      LEFT JOIN obs diagnosisStatus\\n                        ON diagnosis.obs_group_id = diagnosisStatus.obs_group_id AND diagnosisStatus.voided = 0 AND\\n                           diagnosisStatus.concept_id = (SELECT concept_id\\n                                                         FROM concept_name\\n                                                         WHERE name = 'Bahmni Diagnosis Status' AND\\n                                                               concept_name_type = 'FULLY_SPECIFIED')\\n                      LEFT OUTER JOIN concept_name diagnosisStatusConceptName ON diagnosisStatus.value_coded IS NOT NULL\\n                                                                                 AND diagnosisStatus.value_coded =\\n                                                                                     diagnosisStatusConceptName.concept_id\\n                                                                                 AND\\n                                                                                 diagnosisStatusConceptName.concept_name_type\\n                                                                                 = 'FULLY_SPECIFIED'\\n                  ) diagnosis ON diagnosis.person_id = pv.person_id","SELECT\\n  pa.uuid,\\n  app_service.name                                                                                AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\\n  app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\\n  DATE_FORMAT(pa.start_date_time, \\"%d/%m/%Y\\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\\n  CONCAT(DATE_FORMAT(pa.start_date_time, \\"%l:%i %p\\"), \\" - \\", DATE_FORMAT(pa.end_date_time, \\"%l:%i %p\\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\\n  CONCAT(pn.given_name, \\" \\", pn.family_name)                                                      AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\\n  pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`,\\n  pa.appointment_kind                                                                             AS `DASHBOARD_APPOINTMENTS_KIND`,\\n  pa.start_date_time                                                                              AS `DASHBOARD_APPOINTMENTS_START_DATE_KEY`,\\n  pa.end_date_time                                                                                AS `DASHBOARD_APPOINTMENTS_END_DATE_KEY`,\\n  pa.tele_health_video_link\\nFROM\\n  patient_appointment pa\\n  JOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\\n  JOIN appointment_service app_service\\n    ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\\n  LEFT JOIN patient_appointment_provider pap on pa.patient_appointment_id = pap.patient_appointment_id AND (pap.voided=0 OR pap.voided IS NULL)\\n  LEFT JOIN provider prov ON prov.provider_id = pap.provider_id AND prov.retired IS FALSE\\n  LEFT JOIN person_name pn ON pn.person_id = prov.person_id AND pn.voided IS FALSE\\n  LEFT JOIN appointment_service_type app_service_type\\n    ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\\nWHERE p.uuid = ${patientUuid} AND\\n      pa.start_date_time >= CURDATE() AND\\n      (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\\nORDER BY pa.start_date_time ASC;","SELECT\\n  pi.identifier                              AS PATIENT_LISTING_QUEUES_HEADER_IDENTIFIER,\\n  CONCAT(pn.given_name,\\" \\", ifnull(pn.family_name,'')) AS PATIENT_LISTING_QUEUES_HEADER_NAME,\\n  DATE_FORMAT(sb.start_datetime, \\"%d/%m/%Y\\") AS `Date of Surgery`,\\n  l.name                                     AS Location,\\n  providerNames.provider_name                AS `Primary provider`,\\n  p.uuid                                     AS uuid\\nFROM surgical_block sb\\n  INNER JOIN surgical_appointment sa ON sb.surgical_block_id = sa.surgical_block_id\\n                                        AND sb.voided IS FALSE\\n                                        AND sa.voided IS FALSE\\n                                        AND sa.status = \\"SCHEDULED\\"\\n  INNER JOIN person p ON p.person_id = sa.patient_id AND p.voided IS FALSE\\n  INNER JOIN person_name pn ON pn.person_id = sa.patient_id\\n                               AND pn.voided IS FALSE\\n  INNER JOIN patient_identifier pi ON pi.patient_id = pn.person_id AND pi.voided IS FALSE\\n  INNER JOIN patient_identifier_type pit ON pi.identifier_type = pit.patient_identifier_type_id AND\\n                                            pit.name = \\"Patient Identifier\\"\\n  INNER JOIN location l ON sb.location_id = l.location_id AND l.retired IS FALSE\\n  INNER JOIN (\\n               SELECT\\n                 p2.provider_id,\\n                 pn2.person_id,\\n                 CONCAT(pn2.given_name,\\"\\", pn2.family_name) AS provider_name\\n               FROM provider p2\\n                 INNER JOIN person_name pn2 ON pn2.person_id = p2.person_id AND\\n                                               p2.retired IS FALSE AND pn2.voided IS FALSE\\n             ) providerNames ON providerNames.provider_id = sb.primary_provider_id\\nORDER BY sb.start_datetime DESC","SELECT CONCAT(pn.given_name, ' ', IFNULL(pn.middle_name, ''), ' ', IFNULL(pn.family_name, '')) AS \\"name\\",\\n                primaryIdentifier.identifier AS identifier,\\n                IF(extraIdentifier.identifier IS NULL OR extraIdentifier.identifier = '', primaryIdentifier.identifier, extraIdentifier.identifier) AS \\"extraIdentifierVal\\",\\n                CONCAT(\\"\\", p.uuid) AS uuid\\n            FROM person_name pn\\n            JOIN person p ON p.person_id = pn.person_id\\n            JOIN (\\n                SELECT pri.patient_id, pri.identifier \\n                FROM patient_identifier pri \\n                JOIN patient_identifier_type pit ON pri.identifier_type = pit.patient_identifier_type_id \\n                JOIN global_property gp ON gp.property = \\"bahmni.primaryIdentifierType\\" AND gp.property_value = pit.uuid\\n            ) primaryIdentifier ON pn.person_id = primaryIdentifier.patient_id \\n            LEFT OUTER JOIN (\\n                SELECT ei.patient_id, ei.identifier \\n                FROM patient_identifier ei \\n                JOIN patient_identifier_type pit ON ei.identifier_type = pit.patient_identifier_type_id \\n                JOIN global_property gp ON gp.property = \\"bahmni.extraPatientIdentifierTypes\\" AND pit.uuid = LEFT(gp.property_value, 36)\\n            ) extraIdentifier ON pn.person_id = extraIdentifier.patient_id \\n            WHERE pn.person_id IN (\\n                SELECT person_id\\n                FROM obs\\n                WHERE concept_id = (\\n                    SELECT concept_id\\n                    FROM concept_name\\n                    WHERE name LIKE 'Referred to'\\n                    LIMIT 1\\n                )\\n                AND value_complex = (\\n                    SELECT location_id\\n                    FROM location l\\n                    WHERE l.uuid = ${visit_location_uuid}\\n                )\\n                AND person_id NOT IN (\\n                    SELECT patient_id\\n                    FROM encounter en\\n                    WHERE en.location_id = (\\n                        SELECT location_id\\n                        FROM location l\\n                        WHERE l.uuid = ${visit_location_uuid}\\n                    )\\n                    AND en.encounter_datetime > obs.obs_datetime\\n                )\\n                AND obs_datetime > DATE_SUB(NOW(), INTERVAL 1 WEEK) \\n            )\\n            ORDER BY (\\n                SELECT MAX(obs_datetime)\\n                FROM obs o\\n                WHERE o.person_id = pn.person_id\\n                AND o.concept_id = (\\n                    SELECT cn.concept_id\\n                    FROM concept_name cn\\n                    WHERE cn.name LIKE 'Referred to'\\n                    LIMIT 1\\n                )\\n                AND o.value_complex = (\\n                    SELECT l.location_id\\n                    FROM location l\\n                    WHERE l.uuid = ${visit_location_uuid}\\n                )\\n            ) DESC;","select distinct\\n          concat(pn.given_name, \\" \\", ifnull(pn.family_name,'')) as name,\\n          pi.identifier as identifier,\\n          concat(\\"\\",p.uuid) as uuid,\\n          concat(\\"\\",v.uuid) as activeVisitUuid,\\n          IF(va.value_reference = \\"Admitted\\", \\"true\\", \\"false\\") as hasBeenAdmitted\\n        from visit v\\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\\n        join patient_identifier pi on v.patient_id = pi.patient_id\\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\\n        join global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid\\n        join person p on p.person_id = v.patient_id\\n        join orders on orders.patient_id = v.patient_id\\n        join order_type on orders.order_type_id = order_type.order_type_id and order_type.name != \\"Order\\" and order_type.name != \\"Drug Order\\"\\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.voided = 0 and va.attribute_type_id =\\n          (select visit_attribute_type_id from visit_attribute_type where name=\\"Admission Status\\")\\n        where v.date_stopped is null AND v.voided = 0 and order_id not in\\n          (select obs.order_id\\n            from obs\\n          where person_id = pn.person_id and order_id = orders.order_id)","SELECT DISTINCT\\n          concat(pn.given_name, ' ', ifnull(pn.family_name,'')) AS name,\\n          pi.identifier AS identifier,\\n          concat(\\"\\", p.uuid) AS uuid,\\n          concat(\\"\\", v.uuid) AS activeVisitUuid,\\n          IF(va.value_reference = \\"Admitted\\", \\"true\\", \\"false\\") as hasBeenAdmitted\\n        FROM visit v\\n        INNER JOIN person_name pn ON v.patient_id = pn.person_id and pn.voided is FALSE\\n        INNER JOIN patient_identifier pi ON v.patient_id = pi.patient_id and pi.voided is FALSE\\n        INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\\n        INNER JOIN global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid\\n        INNER JOIN person p ON v.patient_id = p.person_id\\n        Inner Join (SELECT DISTINCT v.visit_id\\n          FROM encounter en\\n          INNER JOIN visit v ON v.visit_id = en.visit_id AND en.encounter_type =\\n            (SELECT encounter_type_id\\n              FROM encounter_type\\n            WHERE name = \\"ADMISSION\\")) v1 on v1.visit_id = v.visit_id\\n        INNER JOIN encounter e ON v.visit_id = e.visit_id\\n        INNER JOIN obs o ON e.encounter_id = o.encounter_id\\n        INNER JOIN concept_name cn ON o.value_coded = cn.concept_id AND cn.concept_name_type = \\"FULLY_SPECIFIED\\" AND cn.voided is FALSE\\n        JOIN location l on l.uuid=${visit_location_uuid} and v.location_id = l.location_id\\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id =\\n          (select visit_attribute_type_id from visit_attribute_type where name=\\"Admission Status\\")\\n        LEFT OUTER JOIN encounter e1 ON e1.visit_id = v.visit_id AND e1.encounter_type = (\\n          SELECT encounter_type_id\\n            FROM encounter_type\\n          WHERE name = \\"DISCHARGE\\") AND e1.voided is FALSE\\n        WHERE v.date_stopped IS NULL AND v.voided = 0 AND o.voided = 0 AND cn.name = \\"Discharge Patient\\" AND e1.encounter_id IS NULL","select distinct\\n          concat(pn.given_name,\\" \\", ifnull(pn.family_name,'')) as name,\\n          pi.identifier as identifier,\\n          concat(\\"\\",p.uuid) as uuid,\\n          concat(\\"\\",v.uuid) as activeVisitUuid,\\n          IF(va.value_reference = \\"Admitted\\", \\"true\\", \\"false\\") as hasBeenAdmitted\\n        from visit v\\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\\n        join patient_identifier pi on v.patient_id = pi.patient_id\\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\\n        join global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid\\n        join person p on v.patient_id = p.person_id\\n        join visit_attribute va on v.visit_id = va.visit_id and va.value_reference = \\"Admitted\\" and va.voided = 0\\n        join visit_attribute_type vat on vat.visit_attribute_type_id = va.attribute_type_id and vat.name = \\"Admission Status\\"\\n        join location l on l.uuid=${visit_location_uuid} and v.location_id = l.location_id\\n        where v.date_stopped is null AND v.voided = 0","SELECT DISTINCT\\n  concat(pn.given_name, \\" \\", ifnull(pn.family_name,''))           AS name,\\n  pi.identifier                                        AS identifier,\\n  concat(\\"\\", p.uuid)                                   AS uuid,\\n  concat(\\"\\", v.uuid)                                   AS activeVisitUuid,\\n  IF(va.value_reference = \\"Admitted\\", \\"true\\", \\"false\\") AS hasBeenAdmitted\\nFROM person p\\n  INNER JOIN person_name pn ON pn.person_id = p.person_id\\n  INNER JOIN patient_identifier pi ON pn.person_id = pi.patient_id\\n  INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\\n  INNER JOIN global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid\\n  INNER JOIN visit v ON v.patient_id = p.person_id AND v.date_stopped IS NULL AND v.voided = 0\\n  INNER JOIN (SELECT\\n                max(test_obs.obs_group_id) AS max_id,\\n                test_obs.concept_id,\\n                test_obs.person_id\\n              FROM obs test_obs\\n                INNER JOIN concept c ON c.concept_id = test_obs.concept_id AND test_obs.voided = 0\\n                INNER JOIN concept_name cn\\n                  ON c.concept_id = cn.concept_id AND cn.concept_name_type = \\"FULLY_SPECIFIED\\" AND\\n                     cn.name IN (${testName})\\n              GROUP BY test_obs.person_id, test_obs.concept_id) AS tests ON tests.person_id = v.patient_id\\n  INNER JOIN obs abnormal_obs\\n    ON abnormal_obs.obs_group_id = tests.max_id AND abnormal_obs.value_coded = 1 AND abnormal_obs.voided = 0\\n  INNER JOIN concept abnormal_concept ON abnormal_concept.concept_id = abnormal_obs.concept_id\\n  INNER JOIN concept_name abnormal_concept_name\\n    ON abnormal_concept.concept_id = abnormal_concept_name.concept_id AND\\n       abnormal_concept_name.concept_name_type = \\"FULLY_SPECIFIED\\" AND\\n       abnormal_concept_name.name IN (\\"LAB_ABNORMAL\\")\\n  LEFT OUTER JOIN visit_attribute va ON va.visit_id = v.visit_id AND va.attribute_type_id =\\n                                                                     (SELECT visit_attribute_type_id\\n                                                                      FROM visit_attribute_type\\n                                                                      WHERE name = \\"Admission Status\\")","select distinct concat(pn.given_name,\\" \\", ifnull(pn.family_name,\\"\\")) as name,\\n\\tprimaryIdentifier.identifier as identifier,\\n\\tIF(extraIdentifier.identifier IS NULL OR extraIdentifier.identifier = '', primaryIdentifier.identifier, extraIdentifier.identifier) as \\"extraIdentifierVal\\",\\n\\tconcat(\\"\\",p.uuid) as uuid,\\n\\tconcat(\\"\\",v.uuid) as activeVisitUuid,\\n\\tIF(va.value_reference = \\"Admitted\\", \\"true\\", \\"false\\") as hasBeenAdmitted \\nfrom visit v\\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\\n        join person p on p.person_id = v.patient_id\\n\\t\\tJOIN (SELECT pri.patient_id, pri.identifier \\n\\t\\t\\tFROM patient_identifier pri \\n\\t\\t\\t\\tjoin patient_identifier_type pit on pri.identifier_type = pit.patient_identifier_type_id \\n\\t\\t\\t\\tjoin global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid) primaryIdentifier \\n\\t\\tON v.patient_id = primaryIdentifier.patient_id \\n\\t\\tleft outer JOIN (SELECT ei.patient_id, ei.identifier \\n\\t\\t\\tFROM patient_identifier ei \\n\\t\\t\\t\\tjoin patient_identifier_type pit on ei.identifier_type = pit.patient_identifier_type_id \\n\\t\\t\\t\\tjoin global_property gp on gp.property=\\"bahmni.extraPatientIdentifierTypes\\" and pit.uuid=left(gp.property_value, 36)) extraIdentifier \\n\\t\\tON v.patient_id = extraIdentifier.patient_id \\n        join location l on l.uuid = ${visit_location_uuid} and v.location_id = l.location_id\\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id = (\\n          select visit_attribute_type_id from visit_attribute_type where name=\\"Admission Status\\") and va.voided = 0 \\nwhere v.date_stopped is null AND v.voided = 0;","select distinct concat(pn.given_name,\\" \\", ifnull(pn.family_name,\\"\\")) as name,\\n                primaryIdentifier.identifier as identifier,\\n                IF(extraIdentifier.identifier IS NULL OR extraIdentifier.identifier = '', primaryIdentifier.identifier, extraIdentifier.identifier) as \\"extraIdentifierVal\\",\\n                concat(\\"\\",p.uuid) as uuid,\\n                concat(\\"\\",v.uuid) as activeVisitUuid,\\n                IF(va.value_reference = \\"Admitted\\", \\"true\\", \\"false\\") as hasBeenAdmitted\\n                from visit v\\n                join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\\n                join person p on p.person_id = v.patient_id\\n                JOIN (SELECT pri.patient_id, pri.identifier\\n                FROM patient_identifier pri\\n                join patient_identifier_type pit on pri.identifier_type = pit.patient_identifier_type_id\\n                join global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid) primaryIdentifier\\n                ON v.patient_id = primaryIdentifier.patient_id\\n                left outer JOIN (SELECT ei.patient_id, ei.identifier\\n                FROM patient_identifier ei\\n                join patient_identifier_type pit on ei.identifier_type = pit.patient_identifier_type_id\\n                join global_property gp on gp.property=\\"bahmni.extraPatientIdentifierTypes\\" and pit.uuid=left(gp.property_value, 36)) extraIdentifier\\n                ON v.patient_id = extraIdentifier.patient_id\\n                join location l on l.uuid = ${visit_location_uuid} and v.location_id = l.location_id\\n                left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id = (\\n                select visit_attribute_type_id from visit_attribute_type where name=\\"Admission Status\\") and va.voided = 0\\n                INNER JOIN orders o ON o.patient_id = v.patient_id JOIN order_type ot on ot.order_type_id = o.order_type_id and ot.name = \\"Drug Order\\"\\n                INNER JOIN encounter e on e.encounter_id = o.encounter_id and v.visit_id = e.visit_id\\n                where v.date_stopped is null AND v.voided = 0;","select distinct concat(pn.given_name,\\" \\", ifnull(pn.family_name,\\"\\")) as name,\\n                primaryIdentifier.identifier as identifier,\\n                IF(extraIdentifier.identifier IS NULL OR extraIdentifier.identifier = '', primaryIdentifier.identifier, extraIdentifier.identifier) as \\"extraIdentifierVal\\",\\n                concat(\\"\\",p.uuid) as uuid,\\n                concat(\\"\\",v.uuid) as activeVisitUuid,\\n                IF(va.value_reference = \\"Admitted\\", \\"true\\", \\"false\\") as hasBeenAdmitted\\n                from visit v\\n                join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\\n                join person p on p.person_id = v.patient_id\\n                JOIN (SELECT pri.patient_id, pri.identifier\\n                FROM patient_identifier pri\\n                join patient_identifier_type pit on pri.identifier_type = pit.patient_identifier_type_id\\n                join global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid) primaryIdentifier\\n                ON v.patient_id = primaryIdentifier.patient_id\\n                left outer JOIN (SELECT ei.patient_id, ei.identifier\\n                FROM patient_identifier ei\\n                join patient_identifier_type pit on ei.identifier_type = pit.patient_identifier_type_id\\n                join global_property gp on gp.property=\\"bahmni.extraPatientIdentifierTypes\\" and pit.uuid=left(gp.property_value, 36)) extraIdentifier\\n                ON v.patient_id = extraIdentifier.patient_id\\n                join location l on l.uuid = ${visit_location_uuid} and v.location_id = l.location_id\\n                left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id = (\\n                select visit_attribute_type_id from visit_attribute_type where name=\\"Admission Status\\") and va.voided = 0\\n                INNER JOIN orders o ON o.patient_id = v.patient_id JOIN order_type ot on ot.order_type_id = o.order_type_id and ot.name = \\"Lab Order\\"\\n                INNER JOIN encounter e on e.encounter_id = o.encounter_id and v.visit_id = e.visit_id\\n                LEFT JOIN orders b ON o.order_id = b.previous_order_id\\n                where v.date_stopped is null AND v.voided = 0\\n                AND (o.order_action IS NULL OR o.order_action != 'DISCONTINUE')\\n                AND (o.fulfiller_status IS NULL OR o.fulfiller_status != 'COMPLETED')\\n                AND (b.order_action IS NULL OR b.order_action != 'DISCONTINUE')\\n                AND (b.fulfiller_status IS NULL OR b.fulfiller_status != 'COMPLETED')\\n                ;","select distinct concat(pn.given_name,\\" \\", ifnull(pn.family_name,'')) as name,\\n pi.identifier as identifier,\\n concat(\\"\\",p.uuid) as uuid,\\n concat(\\"\\",v.uuid) as activeVisitUuid,\\n IF(va.value_reference = \\"Admitted\\", \\"true\\", \\"false\\") as hasBeenAdmitted\\n from\\n   visit v join person_name pn on v.patient_id = pn.person_id and pn.voided = 0 and v.voided=0\\n   join patient_identifier pi on v.patient_id = pi.patient_id and pi.voided=0\\n   join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\\n   join global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid\\n   join person p on p.person_id = v.patient_id  and p.voided=0\\n   join encounter en on en.visit_id = v.visit_id and en.voided=0\\n   left outer join location loc on en.location_id = loc.location_id\\n   join encounter_provider ep on ep.encounter_id = en.encounter_id  and ep.voided=0\\n   join provider pr on ep.provider_id=pr.provider_id and pr.retired=0\\n   join person per on pr.person_id=per.person_id and per.voided=0\\n   left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id = (\\n                select visit_attribute_type_id from visit_attribute_type where name=\\"Admission Status\\"\\n            )\\n where\\n   v.date_stopped is null and\\n   loc.uuid=${location_uuid}\\n   order by en.encounter_datetime desc","select distinct concat(pn.given_name,' ', ifnull(pn.family_name,'')) as name,\\n        pi.identifier as identifier,\\n        concat(\\"\\",p.uuid) as uuid,\\n        concat(\\"\\",v.uuid) as activeVisitUuid\\n        from visit v\\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0 AND v.voided = 0\\n        join patient_identifier pi on v.patient_id = pi.patient_id\\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\\n        join global_property gp on gp.property=\\"bahmni.primaryIdentifierType\\" and gp.property_value=pit.uuid\\n        join person p on v.patient_id = p.person_id\\n        join encounter e on v.visit_id = e.visit_id\\n        join obs o on e.encounter_id = o.encounter_id and