\\xdbc1ccf2e35edef0e526facdab658e9d9b1eccac41c1bd28d5914fca27af583b	971	{"constraints":{"max-results":10000,"max-results-bare-rows":2000},"type":"native","middleware":{"js-int-to-string?":true,"ignore-cached-results?":false},"native":{"query":"SELECT \\n    location_query.`Location Name`,\\n    COALESCE(visit_query.`Count`, 0) AS `Count`\\nFROM\\n    (SELECT name AS 'Location Name'\\n     FROM location\\n     WHERE location_id IN\\n         (SELECT location_id\\n          FROM location_tag_map\\n          WHERE location_tag_id IN\\n              (SELECT location_tag_id\\n               FROM location_tag\\n               WHERE name='Login Location'))\\n    ) AS location_query\\n\\nLEFT JOIN\\n\\n    (SELECT \\n        COUNT(*) AS Count,\\n        CAST(CONVERT_TZ(`visit`.`date_started`, '+00:00', '+5:30') AS DATE) AS `Date started`, \\n        `Location`.`name` AS `Location name`\\n    FROM `visit`\\n    LEFT JOIN `location` `Location` ON `visit`.`location_id` = `Location`.`location_id`\\n    LEFT JOIN `person` `Person - Patient` ON `visit`.`patient_id` = `Person - Patient`.`person_id`\\n    WHERE {{date_range}}\\n    AND floor(DATEDIFF(NOW(), `Person - Patient`.`birthdate`) / 365)  < 5\\n    GROUP BY `Location name`, `Date started`\\n    ) AS visit_query\\n\\nON location_query.`Location Name` = visit_query.`Location name`\\nORDER BY location_query.`Location Name` ASC;\\n","template-tags":{"date_range":{"id":"4f8d2e4b-83b1-f787-4e2b-10c8b18145cd","name":"date_range","display-name":"Date range","type":"dimension","dimension":["field",1673,null],"widget-type":"date/month-year","default":null}}},"database":2,"parameters":[{"type":"date/all-options","value":"2023-10-01~2023-11-01","id":"dff1ff45","target":["dimension",["template-tag","date_range"]]}],"async?":true,"cache-ttl":null}
