86	Card	13	1	2023-11-01 06:13:37.511463+00	{"description":null,"archived":false,"collection_position":null,"table_id":null,"database_id":2,"enable_embedding":false,"collection_id":2,"query_type":"native","name":"Female Patient Aged 18 and Above","creator_id":1,"made_public_by_id":null,"embedding_params":null,"cache_ttl":null,"dataset_query":{"type":"native","native":{"query":"SELECT \\n    location_query.`Location Name`,\\n    COALESCE(visit_query.`Count`, 0) AS `Count`\\nFROM\\n    (SELECT name AS 'Location Name'\\n     FROM location\\n     WHERE location_id IN\\n         (SELECT location_id\\n          FROM location_tag_map\\n          WHERE location_tag_id IN\\n              (SELECT location_tag_id\\n               FROM location_tag\\n               WHERE name='Login Location'))\\n    ) AS location_query\\n\\nLEFT JOIN\\n\\n    (SELECT \\n        COUNT(*) AS Count,\\n        CAST(CONVERT_TZ(`visit`.`date_started`, '+00:00', '+5:30') AS DATE) AS `Date started`, \\n        `Location`.`name` AS `Location name`\\n    FROM `visit`\\n    LEFT JOIN `location` `Location` ON `visit`.`location_id` = `Location`.`location_id`\\n    LEFT JOIN `person` `Person - Patient` ON `visit`.`patient_id` = `Person - Patient`.`person_id`\\n    WHERE {{date_range}}\\n    AND floor(DATEDIFF(NOW(), `Person - Patient`.`birthdate`) / 365)  >= 18 \\n    AND `Person - Patient`.`gender` = 'F'\\n    GROUP BY `Location name`, `Date started`\\n    ) AS visit_query\\n\\nON location_query.`Location Name` = visit_query.`Location name`\\nORDER BY location_query.`Location Name` ASC;\\n","template-tags":{"date_range":{"id":"f826cf39-c97f-e636-27fe-458c708cf32c","name":"date_range","display-name":"Date range","type":"dimension","dimension":["field",1673,null],"widget-type":"date/month-year","default":null}}},"database":2},"id":13,"parameter_mappings":[],"display":"bar","entity_id":"-Mbz8f4I5fuLDqLYYJ_b0","collection_preview":true,"visualization_settings":{"graph.show_values":true,"graph.dimensions":["Loca